import React from "react";
import axios from 'axios';

const Weather = () => {
    
    const [latitude, setLatitude] = React.useState('');
    const [longitude, setLongitude] = React.useState('');

    const getLocation = async () => {
        await axios.get(`http://localhost:3001/coordinates/`)
        .then((res) => {
            console.log(res.data);
        })
        .catch((error) => {
            console.error('error');
        });
    }
    
    const getLongAndLat = () => {
        axios.get(`http://localhost:3001/location/`)
        .then((res) => {
            setLongitude(prevLongitude => prevLongitude = res.data.longitude);
            setLatitude(prevLatitude => prevLatitude = res.data.latitude);
            console.log(latitude);
            console.log(longitude);
            getLocation();
        })
        .catch((error) => {
            console.error('error');
        });
    }

    React.useEffect(() => {
        getLongAndLat();
    }, [])


    return (
        <div>
            <span>Your longitude and latitude are:</span>
            <span>{latitude}, {longitude}</span>
        </div>    
    )
}
export default Weather;
